import React from 'react';
import Link from 'next/link';

const Product = ({ title, description, price }) => {
  return (
    <Link href='/selectedProduct'>
      <div>
        <h3>{title}</h3>
        <div>{description}</div>
        <h4>Price: {price}</h4>
      </div>
    </Link>
  );
};

export default Product;
